import { models } from "django-airavata-api";
export default {
  name: "notebook-output-display",
  props: {
    experimentOutput: {
      type: models.OutputDataObjectType,
      required: true
    },
    dataProducts: {
      type: Array,
      required: true
    },
    experimentId: {
      type: String,
      required: true
    },
    providerId: {
      type: String,
      required: true
    }
  },
  data: function data() {
    return {
      rawOutput: null
    };
  },
  computed: {
    url: function url() {
      return "/api/notebook-output?" + "experiment-id=" + encodeURIComponent(this.experimentId) + "&experiment-output-name=" + encodeURIComponent(this.experimentOutput.name) + "&provider-id=" + encodeURIComponent(this.providerId);
    }
  }
};
